import React from "react";
import connect from "./images/connect.png"
import AppCommon from "./AppCommon";

const AppAbout = () => {
    return (
        <>
            <AppCommon
                name="Welcome to about page "
                btnName="contact now"
                imgSrc={connect}
                visit = "/contact"
            />
        </>
    );
}

export default AppAbout;
